import React from 'react';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import GalleryImage from './GalleryImage';


const Gallery = () =>  (
    <div>
    <Row>
        <div>
            <h3>Chiang Mai</h3>
        </div>
    </Row>
    <Row> 
        <Col md={4}>
            <GalleryImage />  
        </Col>      
        <Col md= {4}>
        </Col>
        <Col md= {4}>
        </Col>
    </Row>
    </div>
    

);

export default Gallery;
